text:
+ Nếu quá hạn nhiều hơn 30 ngày, Thư viện sẽ chuyển danh sách độc giả vi phạm cho Phòng Công tác Sinh viên.
- Mọi trường hợp sách bị mất, hư hỏng (rách, mất trang, dính bẩn, ẩm ướt,...) đều phải đền bù theo quy định: giá bìa sách cộng thêm chi phí xử lý tài liệu (50.000 đ/cuốn, hoặc 100.000 đ/cuốn đối với sách hệ thống);
- Đem sách ra ngoài không qua thủ tục tại quầy lưu hành sẽ bị xử phạt 100.000đ/cuốn, truất quyền độc giả và thông báo về Phòng Công tác Sinh viên.
